pragma solidity ^0.6;

import "openzeppelin-solidity/contracts/access/Ownable.sol";
import "openzeppelin-solidity/contracts/math/SafeMath.sol";
import "openzeppelin-solidity/contracts/token/ERC20/SafeERC20.sol";
import "./libraries/Math.sol";
import "./ExchangeERC20.sol";

contract Exchange is ExchangeERC20, Ownable {
    using SafeMath for uint;
    using SafeERC20 for IERC20;

    uint256 r;
    IERC20 assetA;
    IERC20 assetB;

    constructor(string memory _name, string memory _symbol, address _assetA, address _assetB, uint256 _r) 
    ExchangeERC20(_name, _symbol) public {        
        assetA = IERC20(_assetA);
        assetB = IERC20(_assetB);
        r = _r;
    }

    function mintLiquidity(uint256 amountA, uint256 amountB) public returns(uint mintedLiquidity) {
        require(amountA == (r * amountB), "Wrong amounts");
        require(assetA.allowance(msg.sender, address(this)) >= amountA);
        require(assetB.allowance(msg.sender, address(this)) >= amountB);

        uint totalLiquidity = totalSupply();

        if(totalLiquidity == 0) {
            mintedLiquidity = Math.sqrt(amountA.mul(amountB));
        } else {
            uint reserveA = assetA.balanceOf(address(this));
            mintedLiquidity = amountA.div(reserveA) * totalLiquidity;
        }

        assetA.safeTransferFrom(msg.sender, address(this), amountA);
        assetB.safeTransferFrom(msg.sender, address(this), amountB);

        _mint(msg.sender, mintedLiquidity);
    }

    function burnLiquidity(uint256 amountL) public returns(uint totalA, uint totalB) {
        require(allowance(msg.sender, address(this)) >= amountL, "Need to permit token burning");

        uint reserveA = assetA.balanceOf(address(this));
        uint reserveB = assetB.balanceOf(address(this));
        uint totalLiquidity = totalSupply();

        totalA = reserveA.mul(amountL.div(totalLiquidity));
        totalB = reserveB.mul(amountL.div(totalLiquidity));

        assetA.safeTransfer(msg.sender, totalA);
        assetB.safeTransfer(msg.sender, totalB);

        burnFrom(msg.sender, amountL);
    }

    function setRate(uint256 _r) public onlyOwner() {
        r = _r;
    }
}
